import React from "react"; 
import Header from "./Header";
import Home from './Home'; 

//the component that combines all smaller components 
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header />
      </header>
      <Home/>
    </div>
  );
}
function Sat() {
  return (
    <div className="Sat">
      <header className="Sat">
        <Sat />
      </header>
      <Sat/>
    </div>
  );
}
export default App;
